class Solution(object):
    def removeDuplicates1(self, S):
        """
        :type S: str
        :rtype: str
        """
        i = 0
        while(i+1 < len(S)):
            #print(S)
            if(S[i] == S[i+1]):
                print(S)
                #S = S[:i] + S[i+2:]
                S = S.replace(S[i:i+2],"")
                i = 0
                continue
            i+=1
        return S

    def removeDuplicates(self, S):
        """
        :type S: str
        :rtype: str
        """
        res = []
        for c in S:
            if not res:
                res.append(c)
            elif( c == res[-1]):
                print("pop")
                res.pop()
            else:
                res.append(c)
        return "".join(res)
        

